import axios from 'axios'
import React, { useEffect, useState } from 'react'

function Child(url) {
    const [data, setData] = useState(null)

    useEffect(() => {
        axios.get(url).then(res => setData(res.data)).catch(e => e)
    }, [url])

    return (
        <div>Child</div>
    )
}

export default React.memo(Child)
